"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["8893"],{31170(t){t.exports=JSON.parse('{"name":"Git Clone","slug":"git-clone","url":"https://github.com/woodpecker-ci/plugin-git","icon":"https://raw.githubusercontent.com/woodpecker-ci/plugin-git/main/git.svg","description":"This is the default plugin for the clone step.","docs":"<h1>plugin-git</h1>\\n<p>This plugin is automatically introduced into your pipeline as the first step.\\nIts purpose is to clone your Git repository.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>Git LFS support is enabled by default.</li>\\n<li>Fetch tags when needed.</li>\\n<li>Adjust submodules.</li>\\n</ul>\\n<h2>Overriding Settings</h2>\\n<p>You can manually define your <code>clone</code> step in order to change plugin or override some of the default settings.\\nConsult <a href=\\"https://woodpecker-ci.org/docs/usage/workflow-syntax#clone\\">the <code>clone</code> section of the pipeline documentation</a> for more information;\\nthis documentation page only describes this plugin.</p>\\n<pre><code class=\\"language-yaml\\">clone:\\n  git:\\n    image: woodpeckerci/plugin-git\\n    settings:\\n      depth: 50\\n      lfs: false\\n</code></pre>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>depth</code></td>\\n<td><em>none</em></td>\\n<td>If specified, uses git\'s <code>--depth</code> option to create a shallow clone with a limited number of commits, overwritten by <code>partial</code>. Setting it to <code>0</code> disables shallow cloning</td>\\n</tr>\\n<tr>\\n<td><code>lfs</code></td>\\n<td><code>true</code></td>\\n<td>Set this to <code>false</code> to disable retrieval of LFS files</td>\\n</tr>\\n<tr>\\n<td><code>recursive</code></td>\\n<td><code>true</code></td>\\n<td>Clones submodules</td>\\n</tr>\\n<tr>\\n<td><code>skip-verify</code></td>\\n<td><code>false</code></td>\\n<td>Skips the SSL verification</td>\\n</tr>\\n<tr>\\n<td><code>tags</code></td>\\n<td><code>false</code> (except on tag event)</td>\\n<td>Fetches tags when set to true, default is false if event is not tag else true</td>\\n</tr>\\n<tr>\\n<td><code>submodule-override</code></td>\\n<td><em>none</em></td>\\n<td>Override submodule urls</td>\\n</tr>\\n<tr>\\n<td><code>submodule-update-remote</code></td>\\n<td><code>false</code></td>\\n<td>Pass the --remote flag to git submodule update</td>\\n</tr>\\n<tr>\\n<td><code>submodule-partial</code></td>\\n<td><code>true</code></td>\\n<td>Update submodules via partial clone (depth=1)</td>\\n</tr>\\n<tr>\\n<td><code>custom-ssl-path</code></td>\\n<td><em>none</em></td>\\n<td>Set path to custom cert</td>\\n</tr>\\n<tr>\\n<td><code>custom-ssl-url</code></td>\\n<td><em>none</em></td>\\n<td>Set url to custom cert</td>\\n</tr>\\n<tr>\\n<td><code>backoff</code></td>\\n<td><code>5sec</code></td>\\n<td>Change backoff duration</td>\\n</tr>\\n<tr>\\n<td><code>attempts</code></td>\\n<td><code>5</code></td>\\n<td>Change backoff attempts</td>\\n</tr>\\n<tr>\\n<td><code>branch</code></td>\\n<td>$CI_COMMIT_BRANCH</td>\\n<td>Change branch name to checkout to</td>\\n</tr>\\n<tr>\\n<td><code>partial</code></td>\\n<td><code>true</code> (except if tags are fetched)</td>\\n<td>Only fetch the one commit and it\'s blob objects to resolve all files, overwrite depth with 1</td>\\n</tr>\\n<tr>\\n<td><code>home</code></td>\\n<td></td>\\n<td>Change HOME var for commands executed, fail if it does not exist</td>\\n</tr>\\n<tr>\\n<td><code>remote</code></td>\\n<td>$CI_REPO_CLONE_URL</td>\\n<td>Set the git remote url</td>\\n</tr>\\n<tr>\\n<td><code>remote-ssh</code></td>\\n<td>$CI_REPO_CLONE_SSH_URL</td>\\n<td>Set the git SSH remote url</td>\\n</tr>\\n<tr>\\n<td><code>object-format</code></td>\\n<td>detected from commit SHA</td>\\n<td>Set the object format for Git initialization. Supported values: <code>sha1</code>, <code>sha256</code>.</td>\\n</tr>\\n<tr>\\n<td><code>sha</code></td>\\n<td>$CI_COMMIT_SHA</td>\\n<td>git commit hash to retrieve</td>\\n</tr>\\n<tr>\\n<td><code>ref</code></td>\\n<td><em>none</em></td>\\n<td>Set the git reference to retrieve</td>\\n</tr>\\n<tr>\\n<td><code>path</code></td>\\n<td>$CI_WORKSPACE</td>\\n<td>Set destination path to clone to</td>\\n</tr>\\n<tr>\\n<td><code>use-ssh</code></td>\\n<td><code>false</code></td>\\n<td>Clone using SSH</td>\\n</tr>\\n<tr>\\n<td><code>ssh-key</code></td>\\n<td><em>none</em></td>\\n<td>path to SSH key for SSH clone</td>\\n</tr>\\n<tr>\\n<td><code>ssh-key-private</code></td>\\n<td><em>none</em></td>\\n<td>the content of the private key file. Is written into <code>ssh-key</code></td>\\n</tr>\\n<tr>\\n<td><code>merge-pull-request</code></td>\\n<td><code>false</code></td>\\n<td>merge the pull request with the target branch (can fail on merge conflict)</td>\\n</tr>\\n<tr>\\n<td><code>fetch-target-branch</code></td>\\n<td><code>false</code></td>\\n<td>fetch the target branch without merging (useful for tools like nx affected that need both branches locally)</td>\\n</tr>\\n<tr>\\n<td><code>target-branch</code></td>\\n<td>$CI_COMMIT_TARGET_BRANCH</td>\\n<td>Target branch used when merging pull requests (<code>merge-pull-request</code>) or when fetching the target branch (<code>fetch-target-branch</code>)</td>\\n</tr>\\n<tr>\\n<td><code>git-user-name</code></td>\\n<td><em>none</em></td>\\n<td>Git username used when pull requests are used.</td>\\n</tr>\\n<tr>\\n<td><code>git-user-email</code></td>\\n<td><em>none</em></td>\\n<td>Git email used when pull requests are used.</td>\\n</tr>\\n</tbody></table>\\n","tags":["git","clone"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-git","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-git","verified":true,"iconDataUrl":"data:image/svg+xml;base64,"}')}}]);